__device__ __forceinline__ void find_pivot_and_rotate(double* A, const int n, double* E, bool updateEigenVectors) {
    const double epsilon = 1e-12; // A small threshold to handle very small numbers

    for (unsigned int iteration = 0; iteration < 5; iteration++){
        double max_value = epsilon; // Initialize with epsilon to handle small numbers
        int p = -1;
        int q = -1;

        // Find the indices of the largest off-diagonal element in A
        for (int i = 0; i < n; ++i) {
            for (int j = i + 1; j < n; ++j) {
                double abs_value = fabs(A[i * n + j]);
                if (abs_value > max_value) {
                    max_value = abs_value;
                    p = i;
                    q = j;
                }
            }
        }

        if (max_value <= epsilon) { // Check for convergence
            break;
        }

        // Calculate the rotation angle
        double a_pp = A[p * n + p];
        double a_qq = A[q * n + q];
        double a_pq = A[p * n + q];
        double theta = 0.5 * atan2(2.0 * a_pq, a_qq - a_pp); // Use atan2 for better numerical stability
        double c = cos(theta);
        double s = sin(theta);

        // Perform the rotation
        for (int i = 0; i < n; ++i) {
            if (i != p && i != q) {
                double a_ip = A[i * n + p];
                double a_iq = A[i * n + q];
                A[i * n + p] = c * a_ip - s * a_iq;
                A[i * n + q] = s * a_ip + c * a_iq;
                A[p * n + i] = A[i * n + p];  // Maintain symmetry
                A[q * n + i] = A[i * n + q];  // Maintain symmetry
            }
        }

        // Update the diagonal elements
        A[p * n + p] = c * c * a_pp + s * s * a_qq - 2.0 * s * c * a_pq;
        A[q * n + q] = s * s * a_pp + c * c * a_qq + 2.0 * s * c * a_pq;

        // Zero out the pivot element
        A[p * n + q] = 0.0;
        A[q * n + p] = 0.0;  // Maintain symmetry

        if (updateEigenVectors) {
            // Update the rotation matrix
            for (int i = 0; i < n; ++i) {
                double e_ip = E[i * n + p];
                double e_iq = E[i * n + q];
                E[i * n + p] = c * e_ip - s * e_iq;
                E[i * n + q] = s * e_ip + c * e_iq;
            }
        }
    }
}



__device__ void householderQR(const double *A, double *Q, double *R, int n) {
    // Copy A into R and initialize Q as the identity matrix
    for (int i = 0; i < n * n; ++i) {
        R[i] = A[i];
        Q[i] = (i % (n + 1) == 0) ? 1.0 : 0.0; // Identity matrix
    }

    for (int k = 0; k < n - 1; ++k) {
        // Compute the Householder vector for the k-th column
        double norm_x = 0.0;
        for (int i = k; i < n; ++i) {
            norm_x += R[i * n + k] * R[i * n + k];
        }
        double alpha = -copysign(sqrt(norm_x), R[k * n + k]);
        double r = sqrt(0.5 * alpha * alpha - 0.5 * R[k * n + k] * alpha);
        double v[12] = {0}; // Assuming n = 12
        v[k] = (R[k * n + k] - alpha) / (2.0 * r);
        for (int i = k + 1; i < n; ++i) {
            v[i] = R[i * n + k] / (2.0 * r);
        }

        // Apply the transformation to R and Q
        for (int j = k; j < n; ++j) {
            double sum = 0.0;
            for (int i = k; i < n; ++i) {
                sum += v[i] * R[i * n + j];
            }
            for (int i = k; i < n; ++i) {
                R[i * n + j] -= 2.0 * v[i] * sum;
            }
        }

        for (int j = 0; j < n; ++j) {
            double sum = 0.0;
            for (int i = k; i < n; ++i) {
                sum += v[i] * Q[j * n + i];
            }
            for (int i = k; i < n; ++i) {
                Q[j * n + i] -= 2.0 * v[i] * sum;
            }
        }
    }
}



